 ('51', '55', 'en', 'Ramen på Finnes torsdag 21. september', NULL, NULL, NULL, 'left', NULL, '<p>Finnes Kafé is serving Ramen again on the 21st of September, and this time we\'ll make sure that we have enough noodles to serve everyone who visits us! <br /></p>', '0', '0', '0', '2017-09-21 10:14:10', '2017-09-21 10:14:10', '709b9bd8-925a-408e-8c13-7f24753aa4fd'),
 ('52', '56', 'en', NULL, '<p>Ramen will be served from 12PM - 8PM, and the price will be 150NOK. No reservation is needed and we are looking forward to welcome you all!</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-09-21 10:14:10', '2017-09-21 10:14:10', '335e9122-5796-45d4-8e56-995e91c6942d'),
