 ('73', '80', 'en', NULL, '<p>Credo er en råvare-drevet restaurant som åpnet i Credoveita i Trondheim i 1998. Februar 2018 gjenåpner vi på Lilleby i nye lokaler.  </p>', 'Kjærlighet til råvaren', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 11:38:07', '2017-12-17 08:21:09', '37d009e7-7acd-45b0-b32b-00171aa2e49b'),
