 ('76', '83', 'en', 'Forvandlingen på Lilleby ', NULL, NULL, NULL, 'left', NULL, '<p>Credo er en råvare-drevet restaurant som åpnet i Credoveita i Trondheim i 1998. Februar 2018 gjenåpner vi på Lilleby i nye lokaler.  </p>', '0', '0', '0', '2017-12-15 11:58:11', '2017-12-17 13:35:05', 'a706520c-86e5-472e-b4ee-506f8bac0782'),
 ('77', '84', 'en', NULL, '<p>Credo ønsker å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert på det mest interessante og beste vi får levert, fra dag til dag. Vi setter også sammen en drikkemeny som på beste mulige måte komplementerer og løfter frem hver enkelt rett. Har du spesielle ønsker kan du gjerne bestille fra vår rikholdige vinkjeller bestående av flere tusen viner.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 11:58:11', '2017-12-17 13:35:05', '0b870d27-e0f3-4498-8f79-b9d0e6d9000a'),
 ('78', '85', 'en', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 11:58:11', '2017-12-17 13:35:05', 'cd7c4415-3752-4c06-a70f-8b644dbb1812'),
 ('79', '86', 'en', NULL, '<p>Credo ønsker å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert på det mest interessante og beste vi får levert, fra dag til dag. Vi setter også sammen en drikkemeny som på beste mulige måte komplementerer og løfter frem hver enkelt rett. Har du spesielle ønsker kan du gjerne bestille fra vår rikholdige vinkjeller bestående av flere tusen viner.</p>', 'En liten mellomtittel', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:04:13', '2017-12-17 13:35:05', '0bb4e9af-f54f-4d8b-9c07-a27f0e5bd311'),
 ('80', '87', 'en', NULL, '<p>Råvarene er motivasjonen vår. Hvorfor skulle vi ellers betale 260 kroner per kilo smør? Med rent håndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, på gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, månen, sjøen, kroppen.<br /></p>', 'Vegen videre', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:04:13', '2017-12-17 13:35:05', '7fe950f0-2a3c-4b9d-afa8-f0db8766ad8c'),
 ('81', '88', 'en', 'B5 A6477', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:05:02', '2017-12-15 12:05:02', 'a6f1ebcd-6573-44c1-bffc-f318146d3d22'),
 ('82', '89', 'en', 'B5 A7178 Edit', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:07:28', '2017-12-15 12:07:28', 'ff78fc9b-7322-4208-8f17-96da7a372fd9'),
 ('83', '90', 'en', 'Skjølberg Søndre, Svorkmo', NULL, NULL, NULL, 'left', NULL, '<p>Skjølberg Søndre er en biodynamisk kretsløpsgård som drives av Elin Östlund og Carl Erik Skjølberg. </p>', '0', '0', '0', '2017-12-15 12:08:02', '2017-12-15 14:20:17', '57dba44c-5d7b-4def-98d6-e6024ba70c9f'),
 ('84', '91', 'en', NULL, '<p>Her arbeider de med jordbrukskulturer hvor mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale. Å plukke rene, ærlige grønnsaker og urter med egne hender er et høydepunkt for oss som kokker, og vi setter svært stor pris på kunnskapen som Skjølberg Søndre viser oss om agro-økologisk jordbruk.<br /><a href=\"http://www.skjolbergsondre.no/\">www.skjolbergsondre.no</a></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:08:02', '2017-12-15 14:20:17', 'c2c70baf-c490-4313-a423-2bced97e1a82'),
 ('85', '92', 'en', 'B5 A7375', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:09:08', '2017-12-15 12:09:08', '06da3d17-10bd-447f-a72e-f381cd460fb8'),
 ('86', '93', 'en', '41 Z4231 Edit', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:10:26', '2017-12-15 12:10:26', '081f9852-5fcd-41d1-ab2c-b892b125f99f'),
 ('87', '94', 'en', 'Fannremsgården, Orkdal', NULL, NULL, NULL, 'left', NULL, '<p>Småkkå på historien på Fannremsgården.<br /></p>', '0', '0', '0', '2017-12-15 12:10:33', '2017-12-15 14:19:55', 'f98c4494-feb0-4832-9641-70e969c9efb8'),
 ('88', '95', 'en', NULL, '<p>Credo jobber svært tett med historiker og gårdbruker Jon Fredrik Skauge. Blant flere råvarer henter vi ukentlig nykinnet smør, fersk melk, rømme og kjøtt – alt fra gårdens sidete Trønderfe. De ulike sesongene gir råvarer som endrer smak hele tiden, til vår store begeistring.<br /></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:10:33', '2017-12-15 14:19:55', '680635e8-bcdf-4cff-97b3-ed1b0d3be16e'),
 ('89', '96', 'en', '41 Z0093', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:12:34', '2017-12-15 12:12:34', 'd79c377f-433a-4d5c-b993-9c185b344472'),
 ('90', '97', 'en', NULL, '<p>Vi ønsker å integrere deg og kretsløpene som gårdene våre representerer, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarersom best viser egenskapene til tiden vi er i og til stedet vi er på.<br /></p>', 'Vi tar deg nært til smaker, teksturer og følelser. ', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:12:59', '2017-12-17 08:21:10', '5b454c95-f7c5-4859-9d11-8ad97522c41f'),
 ('91', '98', 'en', 'B5 A6903', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:25:43', '2017-12-15 12:25:43', '724c38e1-5fd4-4c05-b97f-2365f7e26505'),
 ('92', '99', 'en', 'Ere8482', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:27:19', '2017-12-15 12:27:19', '32c6ad9d-a019-4050-a96e-1df6da3c1610'),
 ('93', '100', 'en', 'B5 A6629', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:29:35', '2017-12-15 12:29:35', 'eb4f7415-d46c-4ec8-8c01-da5cc08708f2'),
 ('94', '101', 'en', 'Traena 034', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:34:20', '2017-12-15 12:34:20', '767a7cde-5b11-43f0-b8ba-97d0ef5fe4bf'),
 ('95', '102', 'en', NULL, '<p>På Credo skal du få mat laget på råvarer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert på måter der smak og bærekraft er viktige elementer.<br /></p>', 'Credos hjerte ligger der råvarene produseres.', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:34:47', '2017-12-18 12:58:19', '927c9b8d-ba62-4b17-874f-1a5c0fddb000'),
 ('96', '103', 'en', NULL, '<p>Credo åpnet i Credoveita i Trondheim i 1998. Februar 2018 gjenåpner vi på Lilleby i nye lokaler.  </p>', NULL, '', 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:34:47', '2017-12-18 12:58:19', '22b10893-3dfc-45de-a699-0ec7b09f5871'),
 ('97', '104', 'en', NULL, '<p>Credo ønsker å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert på det mest interessante og beste vi får levert, fra dag til dag. Vi setter også sammen en drikkemeny som på beste mulige måte komplementerer og løfter frem hver enkelt rett. Har du spesielle ønsker kan du gjerne bestille fra vår rikholdige vinkjeller bestående av flere tusen viner.<br /></p>\n<p>Med nær kontakt til produsentene våre og med en etisk tilnærming til det vi gjør, søker vi kontinuerlig utvikling mot bærekraft. Vi tror veldig på at dette gjenspeiler seg i smak. <br /></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:34:47', '2017-12-18 12:58:20', '488467dd-66d3-4bef-a537-36ccfdc14acb'),
 ('98', '105', 'en', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:34:47', '2017-12-18 12:58:20', 'b5cb41db-4d7d-4a4e-b7f5-8687b2281ab9'),
 ('99', '106', 'en', NULL, '<p>Råvarene er motivasjonen vår. Hvorfor skulle vi ellers betale 260 kroner per kilo smør? Med rent håndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, på gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, månen, sjøen, kroppen.<br /></p>\n<p>Vi tar deg nært til smaker, teksturer og følelser. Vi ønsker å integrere deg og kretsløpene som gårdene våre representerer, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i og til stedet vi er på.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '2017-12-15 12:34:47', '2017-12-18 12:58:20', '8d1bd7b7-570d-4b39-a10a-dd51cbc44a9a'),
 ('100', '107', 'en', NULL, '<p>Heidi Bjerkan (1970) er en norsk kokk, kjøkkensjef og medeier. Hun åpnet Credo Restaurant i Credoveita, Trondheim i 1997.</p>', 'Heidi', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:34:47', '2017-12-18 12:58:20', '55639f0a-757c-4613-867c-9f29ce2ade0c'),
 ('101', '108', 'en', NULL, '<p>Heidi Bjerkan vokste opp i Trondheim og i båten til bestefaren på Garten - trøndelagskysten. Her knyttet hun sterke bånd til jord og vann, som siden er å se i hennes matlaging. For Heidi Bjerkan er det bøndene som er heltene, og det er produsentene som skal skinne. Gjennom måltidet på Credo tar hun med alle gjestene på hennes tur gjennom gårdene, sjøen og skogen der råvarene kommer fra.<br /></p>\n<p>Heidi Bjerkan engasjerer seg for mer kunnskap, for bedre landbruk og for større interesse for tradisjoner, og Heidi Bjerkan fikk i år Matprisen for sitt engasjement for bedre mat og et bedre landbruk. </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:34:47', '2017-12-18 12:58:20', 'fc13f7ec-7edf-47b5-8c1b-468734382bbe'),
 ('102', '109', 'en', 'B5 A7193', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:37:22', '2017-12-15 12:37:22', '4ee8e850-f2df-4038-b2a3-a3312bf31a1e'),
 ('103', '110', 'en', 'B5 A7794 Bw', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:40:14', '2017-12-15 12:40:14', '0e2cae5b-de23-4a5e-a7f2-af3cae22f3eb'),
 ('104', '111', 'en', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:41:24', '2017-12-18 12:58:20', 'f90363f9-5c2d-4bd5-987e-7ca1ccdf2640'),
 ('105', '112', 'en', NULL, '<p>Skjølberg Søndre er en biodynamisk kretsløpsgård som drives av Elin Östlund og Carl Erik Skjølberg. Her arbeider de med jordbrukskulturer hvor mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale. Å plukke rene, ærlige grønnsaker og urter med egne hender er et høydepunkt for oss som kokker, og vi setter svært stor pris på kunnskapen som Skjølberg Søndre viser oss om agro-økologisk jordbruk.</p>', 'Skjølberg Søndre, Svorkmo', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:41:24', '2017-12-18 12:58:20', '5db5b54d-b600-41f5-a0e3-5f6364c74bb2'),
 ('106', '113', 'en', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:41:24', '2017-12-18 12:58:20', 'e18e927a-b894-4c46-b582-53b21e846a11'),
 ('107', '114', 'en', NULL, '<p>Credo jobber svært tett med historiker og gårdbruker Jon Fredrik Skauge. Blant flere råvarer henter vi ukentlig nykinnet smør, fersk melk, rømme og kjøtt – alt fra gårdens sidete Trønderfe. De ulike sesongene gir råvarer som endrer smak hele tiden, til vår store begeistring.</p>', 'Fannremsgården, Orkdal', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 12:41:24', '2017-12-18 12:58:20', '102b1192-3559-44ca-b9e5-2283a7dbc415'),
 ('108', '115', 'en', 'B5 A6881', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 13:01:52', '2017-12-15 13:01:52', '577174c5-060f-49b0-b63f-f30928562e22'),
 ('110', '117', 'en', NULL, '<p>På Credo ønsker vi å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg det beste fra gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i, og til stedet vi er på. Menyen er satt og hver dag er den basert på det mest interessante og beste vi får levert. </p>', 'Meny', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 13:06:33', '2017-12-15 13:06:33', 'f5735d1b-72bd-4301-84b0-260b1c4d3d39'),
 ('111', '118', 'en', NULL, '<p>Vi setter også sammen en drikkemeny som på beste mulige måte komplementerer og løfter frem hver enkelt rett. Har du spesielle ønsker kan du gjerne bestille fra vår rikholdige vinkjeller bestående av flere tusen viner.<br /></p>\n', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '2017-12-15 13:06:33', '2017-12-15 13:06:33', 'bc589baa-c47c-4b7c-9ddf-eca26669800d'),
 ('112', '119', 'en', NULL, '', 'Credo meny 1050,-  \r\nmed vinpakke 2100,-\r\nLiten Credo meny 830,- \r\nmed vinpakke 1660,-\r\n\r\nVi tilrettelegger menyer innenfor statens regulativ.​​\r\n', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 13:06:34', '2017-12-15 13:06:34', 'd767c1ac-b0db-4463-8858-696256056a40'),
 ('113', '120', 'en', 'B5 A1077', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 13:10:39', '2017-12-15 13:10:39', '530b11c6-4ac7-4a00-b7d5-1a869d1a6d26'),
 ('114', '121', 'en', NULL, '<p>Her legger vi ut pressesaker og pressebilder</p>', 'Omtale', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 13:10:47', '2017-12-15 13:15:13', 'cabe8b7d-9067-4aba-9644-cadfe9d90758'),
 ('115', '122', 'en', 'B5 A1435 2 1', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 13:15:04', '2017-12-15 13:15:04', '7968a14f-544f-4bb5-a05a-8bd199082c12'),
 ('116', '123', 'en', NULL, NULL, NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '2017-12-15 13:48:22', '2017-12-17 08:21:10', 'a2ce9268-10f3-4ae9-8f51-840e732e3ce4'),
 ('117', '124', 'en', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 13:48:22', '2017-12-17 08:21:10', '94cd16c7-def3-48f5-ab21-dee5edee975c'),
