 ('124', '131', 'en', 'Fiskeskoyte', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 13:58:31', '2017-12-15 13:58:31', '94baea81-6a5a-4d4f-b0f6-eae58420d907'),
 ('125', '132', 'en', 'Finnes Skisse', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 14:36:54', '2017-12-15 14:36:54', '9ec73ee2-3cba-4cf3-884a-f35f5c468d9b'),
 ('126', '133', 'en', NULL, '<p>Innkvartert i Lillebys historiske gamle barnehjem er Finnes Kafe det siste kulinariske tillegget til Heidi Bjerkans voksende spisestue.</p>', 'Velkommen til oss', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 14:45:49', '2017-12-15 14:45:49', '42fdca78-a378-48b4-b187-dd84a79d84c5'),
 ('127', '134', 'en', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 14:45:50', '2017-12-15 14:45:50', 'f313a5c8-536c-4ea6-8397-176d5e2f12a7'),
