 ('129', '136', 'en', 'Jossa Bilde Forside Skisse', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 14:58:55', '2017-12-15 15:14:06', '0f3523d9-ad39-4ef9-b98d-0f43461c4bbf'),
 ('130', '137', 'en', 'Jossa Bilde Forside Skisse2', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 15:13:28', '2017-12-15 15:13:28', 'bbe7fc5f-6af8-4ea4-ab4e-83cef9b5d269'),
 ('132', '139', 'en', 'Jossa Bilde Forside Skisse3', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 15:14:35', '2017-12-15 15:14:35', '65c5f6c7-cac5-4f4a-8d24-257b0e9ba055'),
 ('133', '140', 'en', NULL, '<p>Jossa er et rustikk alternativ til Credo, og endrer meny ut i fra hvor Jossa reiser.</p>', 'Credo på tur', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 15:15:34', '2017-12-15 15:18:20', '8f7c688b-0699-4a2d-b5ca-ec9dda648628'),
 ('134', '141', 'en', 'På tur til Peru', NULL, NULL, NULL, 'left', NULL, '<p>På midten av 1900-tallet bodde det en nysgjerrig, ujålete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne nærmest, hadde hun en umettelig utfartstrang i verden. <i>Hva trigget henne?</i> Vi tror det var jakten på de rene smakene. Og mat som ingen hun kjente hadde hørt om før. Rettene måtte ha jordnær betydning for å smake det lille ekstra, i følge Jossa.<br /></p>\n', '0', '0', '0', '2017-12-15 15:17:50', '2017-12-15 15:17:50', '55754e61-ee69-456c-beff-ac607fefdb25');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_standardBodyText`, `field_standardHeading`, `field_standardSubHeading`, `field_settingImagePosition`, `field_customOpeningHours`, `field_standardLeadText`, `field_settingTextOverImage`, `field_settingHeaderAbsolute`, `field_settingHeaderInvert`, `dateCreated`, `dateUpdated`, `uid`) VALUES
 ('135', '142', 'en', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 15:18:20', '2017-12-15 15:18:20', 'dcba83a5-d29b-4a84-b955-d4f85de7f5e3'),
 ('136', '143', 'en', 'B5 A1231', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 15:20:28', '2017-12-15 15:20:28', 'b6d3556d-e91b-497b-a33a-54dc50fe1e3f'),
 ('137', '144', 'en', NULL, '<p>På midten av 1900-tallet bodde det en nysgjerrig, ujålete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne nærmest, hadde hun en umettelig utfartstrang i verden. <em>Hva trigget henne?</em> Vi tror det var jakten på de rene smakene. Og mat som ingen hun kjente hadde hørt om før. Rettene måtte ha jordnær betydning for å smake det lille ekstra, i følge Jossa. Hun ønsket å forstå seg på verden gjennom mat. Vi er derfor veldig glad og takknemlig for å få fortsette historiene hennes videre, gjennom Jossa mat og drikke her i Credoveita.<br /></p>', 'Jossa', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 15:21:00', '2017-12-17 19:00:21', '12e1e277-db19-4ac4-ba3c-1d4e411ce054'),
 ('138', '145', 'en', NULL, '', 'Vi åpner i starten av 2018, så meld deg på nyhetsbrevet vårt for å motta oppdateringer.', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 15:21:00', '2017-12-17 19:00:21', '9edebf16-7fc4-4bae-9d57-39b8ddd5b09c'),
 ('139', '146', 'en', '41 Z9983', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-15 15:22:10', '2017-12-15 15:22:10', '0d263f9a-7b36-46e9-9f86-bf25252a3481'),
