 ('146', '153', 'en', NULL, '<p>Innkvartert i Lillebys historiske gamle barnehjem er Finnes Kafe det siste kulinariske tillegget til Heidi Bjerkans voksende spisestue.</p>', 'Finnes Kafé', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-17 19:27:46', '2017-12-17 19:33:54', 'b36f4eba-629e-435a-9e17-1cae73b3ea55'),
 ('147', '154', 'en', NULL, '<p>En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus på menneskene som maten, bøndene og dyrene, med kjøtt og fisk tilberedt i samme mål, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbrød, andebryst, stekte torskehoder og rabarbraslush.</p>', 'Historien', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-17 19:27:46', '2017-12-17 19:33:54', '9354d70e-17c0-46ad-a115-b34b62beb70a'),
 ('149', '156', 'en', NULL, '<p>Tekst om Heidi En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus på menneskene som maten, bøndene og dyrene, med kjøtt og fisk tilberedt i samme mål, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbrød, andebryst, stekte torskehoder og rabarbraslush.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '2017-12-17 19:27:46', '2017-12-17 19:33:54', 'abaa008a-6dd4-41ad-865d-cf839e4c3ec6'),
 ('150', '157', 'en', 'B5 A7178 Edit', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-17 19:32:52', '2017-12-17 19:32:52', '01afbacf-36ea-4660-bf42-2413d40159d2'),
 ('151', '158', 'en', NULL, '<p>En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus på menneskene som maten, bøndene og dyrene, med kjøtt og fisk tilberedt i samme mål, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbrød, andebryst, stekte torskehoder og rabarbraslush.</p>', 'Menneskene', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-17 19:33:54', '2017-12-17 19:33:54', '1a5a76f4-0b23-4347-9c2c-d550495daacd'),
