 ('154', '161', 'en', NULL, '<p>Navnet på retten — 130,-</p><p>Neste navnet — 150,-</p>', 'Frokost', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-17 19:41:26', '2017-12-17 19:41:26', '84a4fb73-60f1-4177-bf14-503e0e51708c'),
