 ('157', '164', 'en', NULL, '\n<p><em>Mandag 20. desember</em></p>\n<p>Kjøkkenet vårt reiser kulinarisk ut i fra hvor Jossa bestemmer seg for å ta ferden, som kan variere fra uke til uke, måned til måned. Vi henter smaker utenfor Norden men strekker oss så langt vi må for å jobbe med lokale råvarer og produsenter. Er det ikke det, stiller vi likevel kvalitetskrav som gir smaksopplevelser uten dikkedarer.</p>', 'Dagens meny', NULL, 'left', NULL, NULL, '0', '0', '0', '2017-12-17 19:48:05', '2017-12-17 19:48:05', '455da081-81ee-40b3-9dd8-355ad48c8c8d'),
