 ('112', '83', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Vi gjen\\u00e5pner p\\u00e5 Lilleby\",\"slug\":\"vi-gjenapner-pa-lilleby\",\"postDate\":1513339091,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\",\"5\",\"6\"],\"4\":[\"81\"],\"10\":\"<p>Credo er en r\\u00e5vare-drevet restaurant som \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. &nbsp;<\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"],\"standardBodyText\":\"<p>Credos drivkraft er naturen og den kulturelle historien v\\u00e5r. Med n\\u00e6r kontakt til produsentene v\\u00e5re og med en etisk tiln\\u00e6rming til det vi gj\\u00f8r, s\\u00f8ker vi kontinuerlig utvikling mot b\\u00e6rekraft. Vi tror veldig p\\u00e5 at dette gjenspeiler seg i smak.<\\/p>\",\"settingImagePosition\":\"right\"}},\"new1\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":\"\"}}},\"16\":\"\"}}', '2017-12-15 11:58:11', '2017-12-15 11:58:11', 'f0eb4a26-ffa2-4b24-bbe9-4994ca3a521d'),
 ('113', '83', '3', '49', 'en', '2', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Vi gjen\\u00e5pner p\\u00e5 Lilleby\",\"slug\":\"vi-gjenapner-pa-lilleby\",\"postDate\":1513339080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\",\"5\",\"6\"],\"4\":[\"81\"],\"10\":\"<p>Credo er en r\\u00e5vare-drevet restaurant som \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. &nbsp;<\\/p>\",\"3\":{\"84\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"],\"standardBodyText\":\"<p>Credos drivkraft er naturen og den kulturelle historien v\\u00e5r. Med n\\u00e6r kontakt til produsentene v\\u00e5re og med en etisk tiln\\u00e6rming til det vi gj\\u00f8r, s\\u00f8ker vi kontinuerlig utvikling mot b\\u00e6rekraft. Vi tror veldig p\\u00e5 at dette gjenspeiler seg i smak.<\\/p>\",\"settingImagePosition\":\"right\"}},\"85\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"]}}},\"16\":\"\"}}', '2017-12-15 11:58:43', '2017-12-15 11:58:43', 'dce06882-38ac-4022-89db-e498e2548647'),
 ('114', '83', '3', '49', 'en', '3', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Historien om Lilleby\",\"slug\":\"vi-gjenapner-pa-lilleby\",\"postDate\":1513339080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\",\"5\",\"6\"],\"4\":[\"81\"],\"10\":\"<p>Credo er en r\\u00e5vare-drevet restaurant som \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. &nbsp;<\\/p>\",\"3\":{\"84\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"],\"standardBodyText\":\"<p>Credo \\u00f8nsker \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert, fra dag til dag. Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<\\/p>\",\"settingImagePosition\":\"left\"}},\"85\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"54\"]}},\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"En liten mellomtittel\",\"standardBodyText\":\"<p>Credo \\u00f8nsker \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert, fra dag til dag. Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<\\/p>\"}},\"new1\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Vegen videre\",\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>R\\u00e5varene er motivasjonen v\\u00e5r. Hvorfor skulle vi ellers betale 260 kroner per kilo sm\\u00f8r? Med rent h\\u00e5ndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, p\\u00e5 gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, m\\u00e5nen, sj\\u00f8en, kroppen.<br><\\/p>\\r\\n\"}}},\"16\":\"\"}}', '2017-12-15 12:04:13', '2017-12-15 12:04:13', '92b281fc-5b1b-4775-a89c-f275f7b4f3a5'),
 ('115', '90', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Skj\\u00f8lberg S\\u00f8ndre\",\"slug\":\"skjolberg-sondre\",\"postDate\":1513339682,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"88\"],\"10\":\"<p>Skj\\u00f8lberg S\\u00f8ndre er en biodynamisk kretsl\\u00f8psg\\u00e5rd som drives av Elin \\u00d6stlund og Carl Erik Skj\\u00f8lberg.&nbsp;<\\/p>\",\"3\":{\"new1\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"89\"],\"standardBodyText\":\"<p>Her arbeider de med jordbrukskulturer hvor mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale. \\u00c5 plukke rene, \\u00e6rlige gr\\u00f8nnsaker og urter med egne hender er et h\\u00f8ydepunkt for oss som kokker, og vi setter sv\\u00e6rt stor pris p\\u00e5 kunnskapen som Skj\\u00f8lberg S\\u00f8ndre viser oss om agro-\\u00f8kologisk jordbruk.<br><a href=\\\"http:\\/\\/www.skjolbergsondre.no\\/\\\">www.skjolbergsondre.no<\\/a><\\/p>\",\"settingImagePosition\":\"left\"}}},\"16\":\"\"}}', '2017-12-15 12:08:02', '2017-12-15 12:08:02', 'd8c02bd2-3ddb-4b11-9228-207e60bb8f32'),
 ('116', '94', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Fannremsg\\u00e5rden\",\"slug\":\"fannremsgarden\",\"postDate\":1513339833,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"92\"],\"10\":\"<p>Sm\\u00e5kk\\u00e5 p\\u00e5 historien p\\u00e5 Fannremsg\\u00e5rden.<br><\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"93\"],\"standardBodyText\":\"<p>Credo jobber sv\\u00e6rt tett med historiker og g\\u00e5rdbruker Jon Fredrik Skauge. Blant flere r\\u00e5varer henter vi ukentlig nykinnet sm\\u00f8r, fersk melk, r\\u00f8mme og kj\\u00f8tt \\u2013 alt fra g\\u00e5rdens sidete Tr\\u00f8nderfe. De ulike sesongene gir r\\u00e5varer som endrer smak hele tiden, til v\\u00e5r store begeistring.<br><\\/p>\",\"settingImagePosition\":\"left\"}}},\"16\":\"\"}}', '2017-12-15 12:10:33', '2017-12-15 12:10:33', '24688f72-9a86-422a-a3d4-efccf75fb10e'),
 ('117', '7', '4', '49', 'en', '46', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Credo\",\"slug\":\"restaurant\",\"postDate\":1505469180,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":{\"80\":{\"modified\":\"1\",\"type\":\"introBoxes\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"82\",\"78\"],\"standardHeading\":\"Kj\\u00e6rlighet til r\\u00e5varen\",\"standardBodyText\":\"<p>Credo er en r\\u00e5vare-drevet restaurant som \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. &nbsp;<\\/p>\"}},\"60\":{\"modified\":\"1\",\"type\":\"introLinks\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Hva er du p\\u00e5 utkikk etter?\",\"customIntroLinks\":{\"61\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"Book bord\",\"internLink\":[\"55\"],\"externalLink\":\"\"}},\"76\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"Lese journal\",\"internLink\":\"\",\"externalLink\":\"\"}},\"77\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"L\\u00e6re om v\\u00e5r filosofi\",\"internLink\":[\"16\"],\"externalLink\":\"\"}}}}},\"62\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"83\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"new0\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Vi tar deg n\\u00e6rt til smaker, teksturer og f\\u00f8lelser. \",\"standardImages\":[\"96\"],\"standardBodyText\":\"<p>Vi \\u00f8nsker \\u00e5 integrere deg og kretsl\\u00f8pene som g\\u00e5rdene v\\u00e5re representerer, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varersom best viser egenskapene til tiden vi er i og til stedet vi er p\\u00e5.<br><\\/p>\\r\\n\"}}}}}', '2017-12-15 12:12:59', '2017-12-15 12:12:59', '13f4ebbf-598c-447e-b82e-1c5c5aac2d37');
