 ('121', '7', '4', '49', 'en', '50', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Credo\",\"slug\":\"restaurant\",\"postDate\":1505469180,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":{\"60\":{\"modified\":\"1\",\"type\":\"introLinks\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Hva er du p\\u00e5 utkikk etter?\",\"customIntroLinks\":{\"61\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"Book bord\",\"internLink\":[\"55\"],\"externalLink\":\"\"}},\"76\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"Lese journal\",\"internLink\":\"\",\"externalLink\":\"\"}},\"77\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"L\\u00e6re om v\\u00e5r filosofi\",\"internLink\":[\"16\"],\"externalLink\":\"\"}}}}},\"80\":{\"modified\":\"1\",\"type\":\"introBoxes\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"82\",\"78\"],\"standardHeading\":\"Kj\\u00e6rlighet til r\\u00e5varen\",\"standardBodyText\":\"<p>Credo er en r\\u00e5vare-drevet restaurant som \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. &nbsp;<\\/p>\"}},\"62\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"83\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"1\"}},\"97\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Vi tar deg n\\u00e6rt til smaker, teksturer og f\\u00f8lelser. \",\"standardImages\":[\"96\"],\"standardBodyText\":\"<p>Vi \\u00f8nsker \\u00e5 integrere deg og kretsl\\u00f8pene som g\\u00e5rdene v\\u00e5re representerer, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varersom best viser egenskapene til tiden vi er i og til stedet vi er p\\u00e5.<br><\\/p>\"}}}}}', '2017-12-15 12:15:14', '2017-12-15 12:15:14', '48ca704c-6bd0-4537-8a70-6da55adac015'),
 ('122', '16', '4', '49', 'en', '3', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Credos hjerte ligger der r\\u00e5varene produseres.\",\"standardImages\":[\"82\"],\"standardBodyText\":\"<p>P\\u00e5 Credo skal du f\\u00e5 mat laget p\\u00e5 r\\u00e5varer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert p\\u00e5 m\\u00e5ter der smak og b\\u00e6rekraft er viktige elementer.<br><\\/p>\\r\\n\"}},\"new2\":{\"modified\":\"1\",\"type\":\"textQuote\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"81\"],\"standardBodyText\":\"<p>Credo \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. &nbsp;<\\/p>\",\"standardSubHeading\":\"\"}},\"new3\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"98\"],\"standardBodyText\":\"<p>Credo \\u00f8nsker \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert, fra dag til dag. Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<br><\\/p><p>Med n\\u00e6r kontakt til produsentene v\\u00e5re og med en etisk tiln\\u00e6rming til det vi gj\\u00f8r, s\\u00f8ker vi kontinuerlig utvikling mot b\\u00e6rekraft. Vi tror veldig p\\u00e5 at dette gjenspeiler seg i smak. <br><\\/p>\\r\\n\",\"settingImagePosition\":\"left\"}},\"new4\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"99\"]}},\"new5\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>R\\u00e5varene er motivasjonen v\\u00e5r. Hvorfor skulle vi ellers betale 260 kroner per kilo sm\\u00f8r? Med rent h\\u00e5ndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, p\\u00e5 gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, m\\u00e5nen, sj\\u00f8en, kroppen.<br><\\/p>\\r\\n<p>Vi tar deg n\\u00e6rt til smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 integrere deg og kretsl\\u00f8pene som g\\u00e5rdene v\\u00e5re representerer, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er p\\u00e5.<\\/p>\\r\\n<p><\\/p>\",\"settingImagePosition\":\"right\"}},\"new6\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Heidi\",\"standardImages\":[\"78\"],\"standardBodyText\":\"<p>Heidi Bjerkan (1970) er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1997.<\\/p>\"}},\"new7\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi Bjerkan vokste opp i Trondheim og i b\\u00e5ten til bestefaren p\\u00e5 Garten - tr\\u00f8ndelagskysten. Her knyttet hun sterke b\\u00e5nd til jord og vann, som siden er \\u00e5 se i hennes matlaging. For Heidi Bjerkan er det b\\u00f8ndene som er heltene, og det er produsentene som skal skinne. Gjennom m\\u00e5ltidet p\\u00e5 Credo tar hun med alle gjestene p\\u00e5 hennes tur gjennom g\\u00e5rdene, sj\\u00f8en og skogen der r\\u00e5varene kommer fra.<br><\\/p>\\r\\n<p>Heidi Bjerkan engasjerer seg for mer kunnskap, for bedre landbruk og for st\\u00f8rre interesse for tradisjoner, og Heidi Bjerkan fikk i \\u00e5r Matprisen for sitt engasjement for bedre mat og et bedre landbruk. <\\/p>\\r\\n\",\"settingImagePosition\":\"left\"}}}}}', '2017-12-15 12:34:47', '2017-12-15 12:34:47', 'e10e9755-065f-4db4-87bd-5de92691db9a'),
 ('123', '16', '4', '49', 'en', '4', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"102\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Credos hjerte ligger der r\\u00e5varene produseres.\",\"standardImages\":[\"82\"],\"standardBodyText\":\"<p>P\\u00e5 Credo skal du f\\u00e5 mat laget p\\u00e5 r\\u00e5varer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert p\\u00e5 m\\u00e5ter der smak og b\\u00e6rekraft er viktige elementer.<br><\\/p>\"}},\"103\":{\"modified\":\"1\",\"type\":\"textQuote\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"81\"],\"standardBodyText\":\"<p>Credo \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. &nbsp;<\\/p>\",\"standardSubHeading\":\"\"}},\"104\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"98\"],\"standardBodyText\":\"<p>Credo \\u00f8nsker \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert, fra dag til dag. Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<br><\\/p>\\r\\n<p>Med n\\u00e6r kontakt til produsentene v\\u00e5re og med en etisk tiln\\u00e6rming til det vi gj\\u00f8r, s\\u00f8ker vi kontinuerlig utvikling mot b\\u00e6rekraft. Vi tror veldig p\\u00e5 at dette gjenspeiler seg i smak. <br><\\/p>\",\"settingImagePosition\":\"left\"}},\"105\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"99\"]}},\"106\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>R\\u00e5varene er motivasjonen v\\u00e5r. Hvorfor skulle vi ellers betale 260 kroner per kilo sm\\u00f8r? Med rent h\\u00e5ndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, p\\u00e5 gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, m\\u00e5nen, sj\\u00f8en, kroppen.<br><\\/p>\\r\\n<p>Vi tar deg n\\u00e6rt til smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 integrere deg og kretsl\\u00f8pene som g\\u00e5rdene v\\u00e5re representerer, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er p\\u00e5.<\\/p>\",\"settingImagePosition\":\"right\"}},\"107\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Heidi\",\"standardImages\":[\"78\"],\"standardBodyText\":\"<p>Heidi Bjerkan (1970) er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1997.<\\/p>\"}},\"108\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi Bjerkan vokste opp i Trondheim og i b\\u00e5ten til bestefaren p\\u00e5 Garten - tr\\u00f8ndelagskysten. Her knyttet hun sterke b\\u00e5nd til jord og vann, som siden er \\u00e5 se i hennes matlaging. For Heidi Bjerkan er det b\\u00f8ndene som er heltene, og det er produsentene som skal skinne. Gjennom m\\u00e5ltidet p\\u00e5 Credo tar hun med alle gjestene p\\u00e5 hennes tur gjennom g\\u00e5rdene, sj\\u00f8en og skogen der r\\u00e5varene kommer fra.<br><\\/p>\\r\\n<p>Heidi Bjerkan engasjerer seg for mer kunnskap, for bedre landbruk og for st\\u00f8rre interesse for tradisjoner, og Heidi Bjerkan fikk i \\u00e5r Matprisen for sitt engasjement for bedre mat og et bedre landbruk. <\\/p>\",\"settingImagePosition\":\"left\"}},\"new0\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"109\"]}},\"new2\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"standardBodyText\":\"<p>Skj\\u00f8lberg S\\u00f8ndre er en biodynamisk kretsl\\u00f8psg\\u00e5rd som drives av Elin \\u00d6stlund og Carl Erik Skj\\u00f8lberg. Her arbeider de med jordbrukskulturer hvor mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale. \\u00c5 plukke rene, \\u00e6rlige gr\\u00f8nnsaker og urter med egne hender er et h\\u00f8ydepunkt for oss som kokker, og vi setter sv\\u00e6rt stor pris p\\u00e5 kunnskapen som Skj\\u00f8lberg S\\u00f8ndre viser oss om agro-\\u00f8kologisk jordbruk.<\\/p>\"}},\"new3\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"110\"]}},\"new5\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Fannremsg\\u00e5rden, Orkdal\",\"standardBodyText\":\"<p>Credo jobber sv\\u00e6rt tett med historiker og g\\u00e5rdbruker Jon Fredrik Skauge. Blant flere r\\u00e5varer henter vi ukentlig nykinnet sm\\u00f8r, fersk melk, r\\u00f8mme og kj\\u00f8tt \\u2013 alt fra g\\u00e5rdens sidete Tr\\u00f8nderfe. De ulike sesongene gir r\\u00e5varer som endrer smak hele tiden, til v\\u00e5r store begeistring.<\\/p>\"}}}}}', '2017-12-15 12:41:24', '2017-12-15 12:41:24', '0f9a886a-78a4-47c4-9f0d-b114be60ae1c'),
 ('124', '69', '4', '49', 'en', '6', '', '{\"typeId\":\"4\",\"authorId\":\"59\",\"title\":\"Meny\",\"slug\":\"meny\",\"postDate\":1506234240,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Meny\",\"standardImages\":[\"115\"],\"standardBodyText\":\"<p>P\\u00e5 Credo \\u00f8nsker vi \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg det beste fra g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i, og til stedet vi er p\\u00e5. Menyen er satt og hver dag er den basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert. <\\/p>\"}},\"new1\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"88\"],\"standardBodyText\":\"<p>Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<br><\\/p>\\r\\n\",\"settingImagePosition\":\"right\"}},\"new2\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Credo meny 1050,-  \\r\\nmed vinpakke 2100,-\\r\\nLiten Credo meny 830,- \\r\\nmed vinpakke 1660,-\\r\\n\\r\\nVi tilrettelegger menyer innenfor statens regulativ.\\u200b\\u200b\\r\\n\",\"standardBodyText\":\"\"}}}}}', '2017-12-15 13:06:34', '2017-12-15 13:06:34', '01be416e-3522-4b90-862c-ee3040e5ed22'),
