 ('143', '141', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"P\\u00e5 tur til Peru\",\"slug\":\"pa-tur-til-peru\",\"postDate\":1513351070,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"120\"],\"10\":\"<p>P\\u00e5 midten av 1900-tallet bodde det en nysgjerrig, uj\\u00e5lete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne n\\u00e6rmest, hadde hun en umettelig utfartstrang i verden. <i>Hva trigget henne?<\\/i> Vi tror det var jakten p\\u00e5 de rene smakene. Og mat som ingen hun kjente hadde h\\u00f8rt om f\\u00f8r. Rettene m\\u00e5tte ha jordn\\u00e6r betydning for \\u00e5 smake det lille ekstra, i f\\u00f8lge Jossa.<br><\\/p>\\r\\n\",\"3\":\"\",\"16\":\"\"}}', '2017-12-15 15:17:50', '2017-12-15 15:17:50', 'b462da75-2a54-4c25-9aa2-cee557a9604f'),
